  const { isMenu, setIsMenu } = props;
  console.log(isMenu);

  function handleClick_2() {
    setIsMenu(false);
  }
  if (isMenu == true) {
    return (
      <div
        onClick={() => {
          handleClick_2();
        }}
        className="menu"
      >
        <img className="like" src={like} />
      </div>
    );
  }
}

export default Menu;
